\">Let us discover the digestive system by tracing the journey this bite inside the body.</span></p>\\n\"},\"subContentId\":\"1400968c-28f4-4236-a794-6debadbc7da1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":21.151586368978,\"y\":37.122969837587,\"width\":73.7955346651,\"height\":11.832946635731,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\">This is a bite of a sandwich that will enter the mouth and will travel through the <strong><span style=\\\"color:#800080\\\">gastrointestinal tract </span></strong>(also called <span style=\\\"color:#800080\\\"><strong>alimentary canal</strong></span>).</span></p>\\n\"},\"subContentId\":\"1b839682-fbce-4974-a3e6-f782f2d9051e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"}],\"slideBackgroundSelector\":{\"fillSlideBackground\":\"#e8e6e7\"},\"keywords\":[{\"main\":\"A bite of sandwich\"}]},{\"elements\":[{\"x\":0,\"y\":0,\"width\":47.943595769683,\"height\":13.457076566125,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>To discover the digestive system, read the text below and then label the diagram on the right by dragging each word in its proper place</p>\\n\"},\"subContentId\":\"06653669-3329-454a-830c-eeab3b0d307f\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":18.17425,\"width\":44.675872727273,\"height\":76.189394090909,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>The digestive system</strong> is made up of the</p>\\n\\n<p><br />\\n<strong>1- gastrointestinal (GI) tract </strong>including : the mouth, the pharynx, the esophagus, the stomach, the small intestine, the large intestine and the anus. </p>\\n\\n<p><strong>2-</strong> the <strong>liver, </strong>the <strong>pancreas, and </strong>the<strong> gallbladder</strong>.</p>\\n\\n<p>The <strong>liver, pancreas, and gallbladder </strong>are part of the <strong>digestive system</strong> and they play a very important role in digestion, but <strong>they are not part of the gastrointestinal</strong> tract since food <strong>does not enter inside these organs.</strong></p>\\n\"},\"subContentId\":\"7778b703-9e62-4d2d-9e8d-ec40643d04cc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":56.365592635213,\"y\":0,\"width\":43.179900345224,\"height\":99.598485,\"action\":{\"library\":\"H5P.DragQuestion 1.14\",\"params\":{\"scoreShow\":\"Check\",\"tryAgain\":\"Retry\",\"scoreExplanation\":\"Correct answers give +1 point. Incorrect answers give -1 point. The lowest possible score is 0.\",\"question\":{\"settings\":{\"size\":{\"width\":650,\"height\":650},\"background\":{\"path\":\"data:image/jpeg;base64,/9j/4RW8RXhpZgAATU0AKgAAAAgADAEAAAMAAAABA8AAAAEBAAMAAAABAtAAAAECAAMAAAADAAAAngEGAAMAAAABAAIAAAESAAMAAAABAAEAAAEVAAMAAAABAAMAAAEaAAUAAAABAAAApAEbAAUAAAABAAAArAEoAAMAAAABAAIAAAExAAIAAAAdAAAAtAEyAAIAAAAUAAAA0YdpAAQAAAABAAAA6AAAASAACAAIAAgADqYAAAAnEAAOpgAAACcQQWRvYmUgUGhvdG9zaG9wIENDIChXaW5kb3dzKQAyMDE3OjA4OjI3IDEwOjQ3OjEzAAAAAA ",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":83.44686774942,\"width\":99.764982373678,\"height\":11.136890951276,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#008080\\\"><span style=\\\"font-size:1.25em\\\">In the small intestine,<strong> peristalsis</strong> (the same involuntary contractions which occur in the esophagus) forces the food along its way.</span></span></p>\\n\"},\"subContentId\":\"745e13c7-726b-4b3c-9044-7cc74632d42c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":0,\"width\":62.279670975323,\"height\":62.180974477958,\"action\":{\"library\":\"H5P.MultiChoice 1.16\",\"params\":{\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Correct! Digestion continues in the small intestine. Once the chyme reaches the small intestine, a lot of juices from liver, pancreas and intestine (pink arrows) help break down the molecules (in the chyme) into small nutrients. Then, nutrients are absorbed into the bloodstream and transported to different organs of our body.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>More <strong>mechanical </strong>and <strong>chemical digestion,</strong> and <strong>absorption</strong> of nutrients into blood</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Absorption of nutrients takes place in the small intestine, however food is further exposed to a <strong>mechanical </strong>(churning of food) and a <strong>chemical digestion</strong> (with the help of digestive juices from liver, pancreas and intestine) before its absorption into the blood.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Only <strong>absorption</strong> of nutrients into blood.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Oops! Only undigested food (larger black circles in the diagram) is transferred to the large intestine. Nutrients (green dots in the diagram) are absorbed into the blood stream to be distributed to different organs of the body.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div><strong>Absorption</strong> of nutrients into the large intestine.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"submitAnswerButton\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\"},\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"enableCheckButton\":true,\"showScorePoints\":true},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"con  will be absorbed into the bloodstream.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Food is indeed moistened inside the mouth by saliva, however saliva is secreted by salivary glands and not by teeth.</div>\\n\",\"notChosenFeedback\":\"\",\"tip\":\"\"},\"text\":\"<div>They moisten (add liquid) the food by secreting saliva.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"submitAnswerButton\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\"},\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"enableCheckButton\":true,\"showScorePoints\":true},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"question\":\"<p>2 - What is the role of your teeth in the digestion process?</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"media\":{\ back\":{\"chosenFeedback\":\"<div>Exactly! In the small intestine, the digested nutrients are absorbed and transported by the bloodstream to different organs to build and nourish their cells and to provide them with energy. </div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>That absorption takes place in the small intestine.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>The aim of digestion is to break food and drink into their smallest parts (nutrients) so that the<strong> whole body </strong>(not only the intestine) can use them to build and nourish cells and to provide energy. In the small intestine absorption of nutrients takes place.</div>\\n\",\"notChosenFeedback\":\"\",\"tip\":\"\"},\"text\":\"<div>That digestion aims at providing the small intestine with nutrients.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>No! Blood will only transport the digested nutrients to be used by different organs in the body. At this point the nutrients are already in the form that can be used by the organs. Blood does not play a role in the digestion.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>That digested nutrients will be further digested by blood.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"submitAnswerButton\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its corr ll intestine.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>It is larger in diameter (wider). But is it really longer? Look carefully at the diagram. The large intestine is around 1.5 meters long whereas the small intestine is around 7 meters long and it is folded many times to fit in the abdominal cavity.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Longer and wider than the small intestine.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"submitAnswerButton\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\"},\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"enableCheckButton\":true,\"showScorePoints\":true},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"question\":\"<p>7 - And finally this is the large intestine. According to what is shown in the above diagram, we can say that the large intestine is:</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}]},\"library\":\"H5P.MultiChoice 1.16\",\"subContentId\":\"64cc2602-7340-4011-b43c-087ed8db722f\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"And finally this is the large intestine. According to what is shown in the above diagram, we can say that the large intestine is:\",\"authors\":[],\"changes\":[],\"extraTitle\":\"And finally this is the large intestine. According to what is shown in the above diagram, we can say that the large intestine is:\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Right! The large intestine has a particular job in the digestion. It absorbs water from wastes, to create compact stool.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It absorbs water and other particles from the undigested food.</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Right!</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It sends the waste material out of the body via the anus.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>No. The digested nutrients were sent to other organs in the small intestine through their absorption in the bloodstream. In the large intestine, the material can no more be digested. The large intestine will absorb the water contained in this material to create compact stool.</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It further breaks down food into smaller particles.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Oops. We have learned that absorption of digested nutrients takes place in the small intestine. The large intestine contains undigested food material. </div>\\n\",\"notChosenFeedback\":\"\"},\"text\"
